import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, { Autoplay, Pagination, Navigation } from 'swiper';
import 'swiper/swiper.min.css';
import 'swiper/components/pagination/pagination.min.css';
import 'swiper/components/navigation/navigation.min.css';

// Khởi tạo các module Swiper
SwiperCore.use([Autoplay, Pagination, Navigation]);

function Home() {
    return (
        <Swiper
            spaceBetween={30}
            centeredSlides={true}
            autoplay={{
                delay: 2500,
                disableOnInteraction: false,
            }}
            pagination={{
                clickable: true,
            }}
            navigation={true}
            className="mySwiper"
        >
            <SwiperSlide>
                <img className="slide-1" src="https://example.com/slide1.jpg" alt="Slide 1" />
            </SwiperSlide>
            <SwiperSlide>
                <img className="slide-1" src="https://example.com/slide2.jpg" alt="Slide 2" />
            </SwiperSlide>
            {/* Thêm các SwiperSlide khác tại đây */}
        </Swiper>
    );
}

export default Home;
